script: |
  super -f text -I q9532.spq | sort > q9532.out

inputs:
  - name: q9532.spq
    data: |
      SELECT DISTINCT + 17 / - cor0.col2 + + cor0.col0 * cor1.col0 FROM tab1 (FORMAT parquet) cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q9532.out
    data: |
      21
      234
      237
      448
      4992
      5056
      560
      6240
      6320
